import React from 'react'
import logo from '../img/logo.png'

const SignUp = () => {
  return (
    <div className='signUp'>
        <div className="form-container">
            <img className='signUpLogo' src={logo} alt="" />
        </div>
    </div>
  )
}

export default SignUp
